import osimport sysimport logginglogString = "[%(asctime)s: %(levelname)s: %(module)s: %(message)s]"# time/date execution, which level (e.g. root) is code running from, which module is it coming fromlogDir = "logs"logFilePath = os.path.join(logDir, "running_log.log")os.makedirs(logDir, exist_ok = True)logging.basicConfig(    level = logging.INFO,    format = logString,    handlers = [        logging.FileHandler(logFilePath),        logging.StreamHandler(sys.stdout)    ])logger = logging.getLogger("mlproj1_logger")